import React from 'react';
import rogo from './../img/rogo.png';
import { ImageBackground, StyleSheet, Text, View } from "react-native";

const image = require("./img/head_usi.png");

const Home = () => (
  <div>
    <img src={rogo} className="rogo" width="200px" alt="logo" />
    <h1>牛とともに生きる。</h1>
    <h1>食べることは、</h1>
    <h1>生きること。</h1>

  </div>
);

export default Home
